import { HashRouter as Router, Route, Routes } from 'react-router-dom';
// import {Home } from "./Pages"
import {Footer, Header} from "../";
import '../src/assets/style.css';

function App() {
  return (
    <Router>
        <Header />
        <Routes>
          {/* <Route path="/" element={<Home />} />
          <Route path="/Home" element={<Home />} /> */}
        </Routes>
        <Footer/>
    </Router>
  )
}

export default App;
